import { useEffect, useState } from "react";

const Home = () => {

    const [joke, setJoke] = useState(null)

    useEffect( () => {
        fetch("https://api.chucknorris.io/jokes/random")
            .then(res => {
                return res.json()
            })
            .then(data => {
                console.log(data)
            })
    }, [])

    return ( 
        <div className="home">
            <h1>Test</h1>
            {joke.map( (blog) => (
                <div className="blog-preview" key={blog.id}>
                    <h2>{blog.title}</h2>
                    <p>Written by {blog.author}</p>
                </div>
            ))}
        </div>
    );
}
 
export default Home;
